import React, { useState } from "react";
import "./Footer.css";

const Footer = () => {
  const [email, setEmail] = useState("");
  const [subscribed, setSubscribed] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    if (email) {
      setSubscribed(true);
      setEmail("");
      // In a real application, you would send this to your backend
      setTimeout(() => setSubscribed(false), 3000);
    }
  };

  return (
    <footer className="footer" id="contact">
      <div className="container">
        <div className="row">
          {/* Logo & About */}
          <div className="col-lg-4 mb-4 mb-lg-0">
            <h4 className="footer-logo mb-4">
              <i className="fas fa-scale-balanced me-2"></i> LawMaster Pro
            </h4>
            <p>
              Revolutionizing legal practice through AI-powered tools and
              comprehensive legal intelligence.
            </p>
            <div className="social-links d-flex gap-3 mt-3">
              <a href="#"><i className="fab fa-facebook-f"></i></a>
              <a href="#"><i className="fab fa-twitter"></i></a>
              <a href="#"><i className="fab fa-linkedin-in"></i></a>
              <a href="#"><i className="fab fa-instagram"></i></a>
            </div>
          </div>

          {/* Quick Links */}
          <div className="col-md-6 col-lg-2 mb-4 mb-md-0">
            <h5 className="footer-title mb-4">Quick Links</h5>
            <ul className="list-unstyled">
              <li><a href="#">Home</a></li>
              <li><a href="#features">Features</a></li>
              <li><a href="#pricing">Pricing</a></li>
              <li><a href="#">Blog</a></li>
              <li><a href="#contact">Contact</a></li>
            </ul>
          </div>

          {/* Legal Categories */}
          <div className="col-md-6 col-lg-3 mb-4 mb-md-0">
            <h5 className="footer-title mb-4">Legal Categories</h5>
            <ul className="list-unstyled">
              <li><a href="#">Criminal Law</a></li>
              <li><a href="#">Civil Law</a></li>
              <li><a href="#">Corporate Law</a></li>
              <li><a href="#">Property Law</a></li>
              <li><a href="#">Family Law</a></li>
            </ul>
          </div>

          {/* Newsletter */}
          <div className="col-lg-3">
            <h5 className="footer-title mb-4">Newsletter</h5>
            <p>Subscribe to get updates on new features and legal insights.</p>
            {subscribed ? (
              <div className="newsletter-success">
                <i className="fas fa-check-circle"></i> Thank you for subscribing!
              </div>
            ) : (
              <form className="newsletter-form" onSubmit={handleSubmit}>
                <input 
                  type="email" 
                  placeholder="Your email address" 
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                  required 
                />
                <button type="submit">Subscribe</button>
              </form>
            )}
          </div>
        </div>

        <hr className="footer-divider" />

        {/* Bottom Row */}
        <div className="row">
          <div className="col-md-6 mb-3 mb-md-0">
            <p className="mb-0">Â© 2023 LawMaster Pro. All rights reserved.</p>
          </div>
          <div className="col-md-6 text-md-end">
            <a href="#">Privacy Policy</a>
            <span className="mx-2">|</span>
            <a href="#">Terms of Service</a>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
